fe(5,"div",1)(6,"div",4)(7,"div",5)(8,"h3",6),De(9,"Sector Focus"),ue(),fe(10,"p",7),De(11," Since 2016, Walk Free and Wikirate have collaborated to analyse corporate compliance with Modern Slavery Acts through assessment of company statements. Our sector-specific analyses have provided detailed insights into modern slavery reporting practices across different industries, examining unique risks, trends, and gaps in responses. These reports have covered: "),ue()()(),fe(12,"app-slider"),Or(13,j5t,10,4,"div",8),ue()(),fe(14,"div",9)(15,"div",1)(16,"div",4)(17,"div",5)(18,"h3",6),De(19,"Methodology"),ue(),fe(20,"p",7),De(21," Drawing on Walk Free's knowledge of modern slavery due diligence and the Home Office Guidance accompanying the UK Act, the partnership developed a "),fe(22,"b"),De(23,"set of 18 standardised metrics"),ue(),De(24," to assess the content of the statements. "),ue(),fe(25,"p",7),De(26,"In 2024, "),fe(27,"b"),De(28,"3 spotlight metrics"),ue(),De(29," were designed to capture additional aspects of due diligence. The following overview shows how both the UK and Australian legislation guidance and requirements map to the projects' standardised metrics. "),ue(),fe(30,"div",10)(31,"table",11)(32,"thead",12)(33,"tr")(34,"th",13),De(35,"Walk Free metrics on Wikirate platform "),ue(),fe(36,"th",14)(37,"a",15),De(38,"UK MSA Requirements & Guidance"),ue()(),fe(39,"th",14)(40,"a",16),De(41,"Australia MSA Requirements"),ue()()(),fe(42,"tr")(43,"th",17),De(44,"Metric"),ue(),fe(45,"th",18),De(46,"Description"),ue(),fe(47,"th",19),De(48,"Requirements & Guidance"),ue(),fe(49,"th",19),De(50,"Requirements & Criterion"),ue()()(),fe(51,"tbody"),Or(52,H5t,10,7,"tr",20),ue()(),fe(53,"div",21)(54,"div",22)(55,"div",23),De(56,"Mandatory"),ue(),fe(57,"div",24),Ar(58,"div",25),ue()(),fe(59,"div",22)(60,"div",23),De(61,"Not Mandatory"),ue(),fe(62,"div",24),Ar(63,"div",26),ue()()(),fe(64,"table",27)(65,"thead",12)(66,"tr")(67,"th",28),De(68,"Spotlight metrics "),ue()(),fe(69,"tr")